<script>
    import moment from 'moment';
    import PlanInfo from "../../components/scene/PlanInfo";
    import { WidgetHelper, Splitter, SchedulerPro, ProjectModel, Toolbar, ResourceHistogram, LocaleManager } from 'major-schedulerpro';
    import Cn from '@/components/resourcesHistogram/schedulerpro.locale.Cn.js'
    // This CSS must be imported here because it is in package
    import 'major-schedulerpro/schedulerpro.stockholm.css';
    import IntelligentPlan from "../../components/scene/IntelligentPlan";

    export default {
        name: "demoResourceHistogram",
        components: {IntelligentPlan, PlanInfo},
        props: {},
        data() {
            return {
                images: require('@/assets/images/avatar.png'),
                project: null,//资源负荷数据
                scheduler: null,//资源负荷实例对象
                histogram: null,//资源冲突 实例对象
                sceneEditionId: null,
                startDate: null,
                endDate: null,
                intelligentPlanModelVisible: false

            };
        },
        computed: {},
        watch: {},
        methods: {
            moment,
            init() {
                //国际化
                this.setLocaleLang()
                //加载数据

                const { project } = this.getData()
                //加载资源负荷图
                this.setSchedulerPro({ project: project })
                new Splitter({
                    appendTo: 'container'
                });
                //资源冲突部分
                this.resourceHistogram({ project: project })
                //底部操作栏
                this.setBottomToolBar()
            },
            //资源负荷数据
            getData() {

                const project = new ProjectModel({
                    transport: {
                        load: {
                            //url: 'data/data.json',
                            url: '/bs/scheduler/ganttData',
                            params: {
                                sceneEditionId: this.sceneEditionId
                            },
                        },
                        eventStore: {
                            fields: ['resources']
                        }
                    },
                    autoLoad: true
                });
                return { project: project }
            },
            // 资源负荷
            setSchedulerPro({ project }) {
                this.scheduler = new SchedulerPro({
                    appendTo: 'container',
                    minHeight: '10em',
                    flex: '1 1 50%',
                    defaultResourceImageName: '/',//对应图片名称后缀
                    rowHeight: 50,
                    startDate: this.startDate,
                    endDate: this.endDate,
                    viewPreset: 'dayAndWeek',
                    eventStyle: 'plain',
                    tickSize: 70,
                    columns: [
                        {
                            type: 'resourceInfo', showEventCount: true, showRole: true, editor: false, imagePath: this.images, showImage: true, text: '资源', field: 'name',
                        },
                        // { text: '城市', field: 'city', width: 90 }
                    ],
                    project
                });
            },
            //资源冲突部分
            resourceHistogram({ project }) {
                // TODO: this option should be collected from partner
                this.histogram = new ResourceHistogram({
                    project, //数据
                    hideHeaders: true,
                    partner: this.scheduler, //
                    appendTo: 'container',
                    rowHeight: 50,
                    minHeight: '10em',
                    flex: '1 1 50%',
                    showBarTip: true,
                    autoHeight: true,
                    getBarText: (datum) => {
                        console.log(datum)
                        return datum.effort ? new Date(datum.tick.startDate).getDate() : null;
                    },
                    columns: [{
                        type: 'resourceInfo',
                        text: '资源',
                        field: 'name',
                        flex: 1,
                        showImage: false,
                        showEventCount: false,
                        imagePath: ''
                    },]
                });
            },
            //国际化
            setLocaleLang() {
                LocaleManager.registerLocale('Cn', { locale: Cn });
                LocaleManager.locale = Cn;
            },
            //底部操作栏
            setBottomToolBar() {
                new Toolbar({
                    appendTo: "container",
                    cls: 'histogram-toolbar',
                    items: [{
                        type: 'checkbox',
                        ref: 'showBarText',
                        text: '资源负荷文本&emsp;',
                        tooltip: '',
                        checked: false,
                        onAction: ({ source }) => {
                            this.histogram.showBarText = source.checked;
                        }
                    },
                        {
                            type: 'checkbox',
                            ref: 'showMaxEffort',
                            text: '资源分配曲线&emsp;',
                            tooltip: '',
                            checked: true,
                            onAction: ({ source }) => {
                                this.histogram.showMaxEffort = source.checked;
                            }
                        },
                        {
                            type: 'checkbox',
                            ref: 'showBarTip',
                            text: 'Enable bar toolti ',
                            tooltip: '',
                            checked: true,
                            onAction: ({ source }) => {
                                this.histogram.showBarTip = source.checked;
                            }
                        }
                    ]
                });
            },
            intelligentPlan() {
                this.intelligentPlanModelVisible = true;
            }

        },
        created() {
            this.sceneEditionId = this.$route.params.sceneEditionId;
            this.startDate = this.$route.params.startDate;
            this.endDate = this.$route.params.endDate;
        },
        mounted() {
            this.init()
        },
    }
</script>
